  constructor(props) {
    super(props);
    this.selectProductPage = this.selectProductPage.bind(this);
    this.state = {reload: false};
  }


  //selectProductPage() { /* completing stuff */ }


  selectProductPage() {

    this.setState({reload: !this.state.reload});
    console.log("asdasdasdsd")
  };

render() {
    let reload = this.state.reload;
return (

    <div>
    <PageContent reload ={reload}/>
    <Button onClick={this.selectProductPage}>sasasa</Button>
    </div>
);

   function  PageContent(props) {
